  input: '"TEXT","F3XA","C00003111","The payments for salaries and wages listed as
    not FEA are for employees who did not spend more than 25% of their time on Federal
    Election Activity.  None of the expenditures for direct mail, fundraising, postage
    and telemarketing included on Schedule B supporting line 21(b) were on behalf
    of a clearly identified candidate for federal office and do not promote, support,
    attack or oppose any candidate for federal office.  This amendment being filed
    in response to FEC correspondence dated July 29, 2005.    The $11,705.51 transfer
    from the 2004 Joint State Victory Committee was the final distribution for 2004
    which was received in January 2005.  All donors were previously itemized with
    earlier memos.  If all memo pages were added up, and then all distributions were
    added up, the memos will be slightly higher than the actual distributions.  The
    memos are gross contributions and the distributions are net of expenses.  These
    must be viewed as totals and cannot be matched with specific memos.  All references  for
    catering for special event, reimbursement for special event, rental space - special
    event, rental special event and special event refer to an inaugural event for
    the new chairman, Maine Republican Party.  These expenditures were not made on
    behalf of any specific federal candidate.  On Schedule B, disclosed payments for
    Ad Campaign, Maine Veto, Advertising, Mailer and Mailer for inaugural chair were
    not for any specific candidate for federal office.  They are all related to telemarketing,
    state issues and/or direct plea for funds.  On Schedule H4, payments for Payroll
    - FEA and Insurance were miscoded when originally put in the system.  The insurance
    premium is for workers compensation and purely an administrative expense.  The
    payroll is truly FEA.  This employee worked in December 2004; however, was not
    paid until January 2005.  It is purely a federal expense and no non-federal funds
    were used.  On Schedule H3, transfers-in from non-federal account (s) do not exceed
    permissible amount indicated by the allocation ratio.  There were no funds transferred
    for joint disbursements.  On Schedule H4, the disbursement to Republican National
    Committee was the return of the $11,705.51 (the last payment received from the
    2004 Joint State Victory Committee).  Please refer to the paragraph in your letter
    referencing Schedule A."'
